  height: 74px;
`;
const FrameInner = styled.img`
  position: absolute;
  top: 384px;
  left: 265px;
  border-radius: 50%;
  width: 113px;
  height: 113px;
  object-fit: cover;
`;
const Role4Eastlighting1gachonac = styled.div`
  position: absolute;
  top: 507px;
  left: 194px;
  display: inline-block;
  width: 256px;
  height: 99px;
`;
const EllipseIcon = styled.img`
  position: absolute;
  top: 384px;
  left: 600px;
  border-radius: 50%;
  width: 113px;
  height: 113px;
  object-fit: cover;
`;
const Role5Hmuy913gachonackr = styled.div`
  position: absolute;
  top: 507px;
  left: 533px;
  display: inline-block;
  width: 247px;
  height: 95px;
`;
const FrameChild1 = styled.img`
  position: absolute;
  top: 178px;
  left: 433px;
  border-radius: 50%;
  width: 113px;
  height: 113px;
  object-fit: cover;
`;
const Role2Xornjswldhgachonackr = styled.div`
  position: absolute;
  top: 300px;
  left: 363px;
  display: inline-block;
  width: 253px;
  height: 97px;
`;
const Role3Ms987796gachonackr = styled.div`
  position: absolute;
  top: 300px;
  left: 684px;
