  object-fit: cover;
`;
const RectangleDiv = styled.div`
  position: absolute;
  top: 0px;
  left: 0px;
  background-color: var(--color-white);
  width: 1005px;
  height: 63px;
`;
const Home = styled.div`
  position: absolute;
  top: 0px;
  left: 677px;
  font-size: var(--font-size-mini);
  color: var(--color-gray-400);
  display: flex;
  align-items: center;
  justify-content: center;
  width: 66px;
  height: 63px;
  cursor: pointer;
`;
const Team = styled.div`
  position: absolute;
  top: 0px;
  left: 755px;
  font-size: var(--font-size-mini);
  color: var(--color-gray-400);
  display: flex;
  align-items: center;
  justify-content: center;
  width: 66px;
  height: 63px;
  cursor: pointer;
`;
const Vision = styled.div`
  position: absolute;
  top: 0px;
  left: 833px;
  font-size: var(--font-size-mini);
  color: var(--color-gray-400);
  display: flex;
  align-items: center;
  justify-content: center;
  width: 66px;
  height: 63px;
`;
const Value = styled.div`
  position: absolute;
  top: 0px;
  left: 911px;
  font-size: var(--font-size-mini);
  color: var(--color-gray-400);
  display: flex;
  align-items: center;
  justify-content: center;
  width: 66px;
  height: 63px;
  cursor: pointer;
`;
const Geeklogo1Icon = styled.img`
  position: absolute;
  top: 0px;
  left: 22px;
